import './App.css';
import cleaning from './cleaning.jpg';
import Navbar from './navbar.js';
import Form from './form.js';

function App() {
  return (
    <div className='App'>
      <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.1.3/dist/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-1BmE4kWBq78iYhFldvKuhfTAU6auU8tT94WrHftjDbrCEXSU1oBoqyl2QvZ6jIW3" crossorigin="anonymous"/>
      <Navbar/>
      <h1 id='headerOne'>COVID Submissions</h1>
      <h3>Use this online tool to manage vaccination status for employees as well as tracking COVID tests from non-vaccinated individuals.</h3>
      <img id='image1' src={cleaning} alt='image1'/>
      <h4 id='headerTwo'>Answer the quesions below and submit accurate responses. After responding you will receive an option to either submit a picture of your vaccination card or a negative covid test.</h4>
      <Form/>
    </div>
  );
}

export default App;
